import React, { Component } from 'react';
import {Route, NavLink, Switch} from "react-router-dom";
import Home from './pages/home';

import Nav from './components/navbar/navbar';
import Fam from './components/email/join';
import Foot from './components/footer/sponsor';

import About from './pages/about/about';
import Rules from './pages/rules/rules';
import Regi from './pages/register/register';
import Events from './pages/events/events';
import Pricing from './pages/pricing/pricing';
import Pay from './pages/payment/payment';

import './App.css';

import {
  CSSTransition,
  TransitionGroup,
} from 'react-transition-group';


function App() {
  return (
    <div className="App">

      <body>
          {/*Navigation*/}
          <Nav />
          <CSSTransition
            timeout={300}
            classNames="change"
          >
          <Switch>

            {/*Routes for Different Pages*/}

            <Route exact path="/" component={Home} />
            <Route exact path="/About" component={About} />
            <Route exact path="/Rules" component={Rules} />
            <Route exact path="/Register" component={Regi} />
            <Route exact path="/Events" component={Events} />
            <Route exact path="/Classes" component={Pricing} />
            <Route exact path="/Payment" component={Pay} />

          </Switch>
          </CSSTransition>

          {/*Email and Footer*/}
          <Fam />
          <Foot />
      </body>

    </div>
  );
}

export default App;
